--SERVICIO
DO $$
BEGIN
CREATE TEMPORARY TABLE tmp_servicio (
    ids                 BIGSERIAL,
    curp                CHAR(18),
    rfc                 CHAR(22),
    placas              VARCHAR(8),
    num_pasajeros       CHAR(1),
    latitud_origen      float,
    longitud_origen    float,
    latitud_destino     float,
    longitud_destino    float,
    tiempo              TIME,
    distancia           real,
    clase               CHAR(1),
    cantidad            MONEY,
    metodo              BOOLEAN,
    puntos_generados    NUMERIC
);



    FOR counter IN 1.5 LOOP
            SELECT curp
            FROM cliente
            ORDER BY random();
    END LOOP;

    DELETE FROM tmp_servicio
    WHERE curp = NULL

        ids,
        curp, 
        rfc, 
        placas, 
        num_pasajeros, 
        latitud_origen,
        longitud_origen,
        latitud_destino,
        longitud_destino,
        tiempo,
        clase,
        metodo)
    SELECT ids,
        curp, 
        rfc, 
        placas, 
        num_pasajeros, 
        latitud_origen,
        longitud_origen,
        latitud_destino,
        longitud_destino,
        tiempo,
        clase,
        metodo
    FROM tmp_servicio;

END; $$
